import React, { useState } from "react";
import axios, { Axios } from "axios";

axios.get("https://api.scryfall.com/sets")
    .then(res => {
    const sets = res.data;
    })

const SetSelect  = () => {

    return(
        <ul>
            {
            sets.map(sets =>
                <li key = {sets.id}>{sets}</li>)
            }
        </ul>
    )
}

export default SetSelect
